func TestCumSum(t *testing.T) {
	_cum := cum.NewSum()
	res := make([]float64, len(vals))
	for i := range vals {
		res[i] = _cum.App(vals[i])
	}
	if err := compare(res, resCumSum, 1e-8); err != nil {
		t.Fatal(err)
	}
}

